function DetailBook(){

   return (
    <Card
    key={i} 
    style={{
      width: '14rem',
      margin: "8px",
      height: "25rem"
    }}
     >
    <img
    style={{
          width: '14rem',
          height:'14rem'
    }}
    const a = {elem.image}
      alt="Sample"
      src={(`/assets/images/${elem.image}`)}
    />
    <CardBody>
      <CardTitle tag="h5">
        {elem.name}
      </CardTitle>
      <CardSubtitle
        className="mb-2 text-muted"
        tag="h6">
       Price : {elem.price} $
      </CardSubtitle>
      <Link to={`detail/${elem._id}`}>
      <Button color="primary">
        Details
      </Button>
      </Link>

    </CardBody>
  </Card>
   )
    
}
export default DetailBook
